import FriendlyPic from "../images/friendlyPic.jpg";

const friendlyImgStyles = {
  backgroundImage: "url(" + FriendlyPic + ")",
  backgroundSize: "cover",
  backgroundPosition: "center",
};

const FriendlyAd = () => {
  return (
    <div className="friendly-container mr-20 mt-8 ">
      <div className="friendly-img rounded-lg" style={friendlyImgStyles}>
        <h3>Fast Service</h3>
        <h3>Fair Fees</h3>
        <h3>Family friendly enviornment</h3>
      </div>
    </div>
  );
};
export default FriendlyAd;
